import React from "react";
import { Link, NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div class="sidenav">
      <a href="#">Dashboard</a>
      <a href="#">Login</a>
      <a href="#">Clients</a>
      <a href="#">Contact</a>
    </div>
  );
};

export default NavBar;
